import '../../App.css';

function GameOver(){
    document.body.style = "background: #000";
    return(
        <div className="GameOver">
            <div className="card">
                <h1>GameOver</h1>
                <button className="btnContinuePlaying">Comenzar de nuevo</button>
            </div>
        </div>
    )
}
export default GameOver;
